# -*- coding: utf-8 -*-
import base64

def Image2Base64(imagePath = '../data/validation/neutral/[www.google.com][1989].jpg'):
    '''
    :desc 用户给出图片路径，将其转化为bash64形式
    :param imagePath:
    :return:
    '''
    with open(imagePath,'rb') as f:
        imageda = f.read()
        Base64 = base64.b64encode(imageda).decode("utf8")
        print(Base64)
    return Base64

def base64ToImage(base64String, imagePath ):
    """
    decrib ：用户发过来图片的bash64形式字符串，函数读取后返回出去。
    :param base64String:
    :param imageName:
    :return:imageData
    """
    imageData = base64.b64decode(base64String)
    with open(imagePath,'wb') as f:
        f.write(imageData)
    return imagePath


